import React, { Component } from 'react';

//style
import "../style/notecardStyle.scss";

class NoteCard extends Component {

  render() {
    const {title, body, editCall} = this.props
    return (

     <div className="note-card-container" onClick={editCall}>
       <div className="note-card-content" >

        <div className="note-card-title">{title}</div>

        <div className="note-card-body">
            {body} 
          <div className="fade-out-truncation"></div>
        </div>
        <div className="x-button"></div>
       </div>
     </div>
    )          
  }
}

export default NoteCard;
